import {Link} from 'react-router-dom'
function matchSmallComponent(props) {

  if(!props.match){return null} // important

    return (
      <div className="matchSmallComponent">

        <h4>Match Small Component, Date: {props.match.date}</h4>

        <p><Link to = {`/team/${props.match.team1}`}>{props.match.team1} </Link> 
        VS 
        <Link to = {`/team/${props.match.team2}`}> {props.match.team2}</Link></p>

        <p>Winner: {props.match.winningTeam}</p>
      </div>
    );
  }

  export default matchSmallComponent;
